import React from "react";
function hit(event) {
  {
    this.props.onClick !== "canncel"
      ? this.props.onClick([
          {
            id: props.id,
            name: props.name,
            imgUrl: props.imgUrl,
            HP: props.HP,
            ATK: props.ATK,
          },
        ])
      : event.preventDefault();
  }
}

function Card(props) {
  return (
    <div id="pokemon-item" onClick={(event) => {}}>
      <img src={props.imgUrl} alt={props.name} />
      <p> {props.name}</p>
      <p>{`HP: ${props.HP}   ATK: ${props.ATK}`}</p>
    </div>
  );
}
export default Card;
